import './App.css';

function App() {
  return (
    <div className="App">
      <html lang="en" theme="day">
        <head>
        <body>
        <ob-azimuth-large target="90" value = "80" angle = "45" targetAngle="60"/>
    </body>

        <link rel="stylesheet" href="https://unpkg.com/openbridge-css@0.2.1/dist/css/openbridge.css"></link>
        </head>
        <body>
            <ob-azimuth-large target="90" value = "80" angle = "45" targetAngle="60"/>
        </body>

      </html>

    </div>
  );
}

export default App;
